import { typesUser } from '../../actions/user/Username'

const initialState = {
  email: 'null',
  name: 'null'
}

export function userReducer(state = initialState, action = {}) {
  switch (action.type) {
    case typesUser.USERNAME.REQUEST:
      return {   
        ...state,
        email: action.data.email,
        name: action.name,
      }
    case typesUser.USERNAME.SUCCESS:
      return {   
        ...state,
        email: action.email,
        name: action.name,
      }
    default:
      return state
  }
}
